function initializedMqtt(){client=new Paho.MQTT.Client("m13.cloudmqtt.com",35424,"web_"+parseInt(Math.random()*100,10));client.onConnectionLost=onConnectionLost;client.onMessageArrived=onMessageArrived;var n={useSSL:!0,userName:"web",password:"password",onSuccess:onConnect,onFailure:doFail};client.connect(n)}function onConnect(){console.log("onConnect");client.subscribe("control/123456/request")}function doFail(n){alert("failure: "+n);console.log(n)}function onConnectionLost(n){n.errorCode!==0&&(alert("connection lost: "+n.errorMessage),console.log("onConnectionLost:"+n.errorMessage))}function sendCommand(n){message=new Paho.MQTT.Message(n);message.destinationName="control/123456/request";client.send(message)}function onMessageArrived(n){console.log("onMessageArrived:"+n.payloadString)}function onConnect(){console.log("onConnect");client.subscribe("control/123456/request")}